    private static Map<Integer, Integer> mem = new HashMap<>();
    private static boolean allZero(int [] arr) {
        int n = arr.length;
        for(int i=0; i<n; i++) {
            if (arr[i] == 1) {
                return false;
            }
        }
        return true;
    }

    private static int runJosephus(int[] arr) {
        int n = arr.length;
        int ind = 0;
        int m = primes[ind++];
        int curr = (m - 1) % n;
        while (true) {
            arr[curr] = 0;
            if (allZero(arr)) return curr+1;

            m = primes[ind++];

            for (int i = 0; i < m; i++) {
                curr = (curr + 1) % n;
                while (arr[curr] == 0) {
                    curr++;
                    curr = curr % n;
                }
            }
        }
    }

